import Layout from '../../components/Layout';
import React from 'react';
import './loginStyle.scss'

const Login =()=> {
    return(
        <Layout title="Panier" description="This is the Cart page" >

           <h3 className="d-block mx-auto m-text">Connection</h3>
           <i class="fa fa-user-circle mx-auto" aria-hidden="true"></i>
           <input className=" d-block m-input mx-auto" type="text"/>
           <input className=" d-block m-input mx-auto" type="text"/>
           <div className="m-div">
           <button type="button" className="btn btn-outline-primary">
               Connexion
           </button>
           </div>
        </Layout>
    )
}
export default Login;
